                    "title": "Hijacking of Singapore Airline Flight SQ 117|ത്രില്ലർ|BS Chandra Mohan| Mlife Daily",
                    "description": "Hijacking of Singapore Airline Flight SQ 117\n\nThe plane, an Airbus A310 with registration 9V-STP, had taken off from Sultan Abdul Aziz Shah Airport in Subang near Kuala Lumpur, Malaysia at 21:15 SST, with 114 passengers and 11 crew on board.[3] The plane was hijacked in mid-air while en route to Singapore Changi Airport by four Pakistanis. The hijackers were armed with explosives and knives but no firearms.\n\n It landed safely at Changi Airport at 22:15, where a group of officials from the Ministry of Defence, Ministry of Home Affairs and Ministry of Information, Communications and the Arts, along with Singapore Airlines representatives and a negotiating team, were waiting.\n\nThe hijackers, who claimed to be members of the Pakistan Peoples Party (PPP), demanded the release of former Prime Minister of Pakistan Benazir Bhutto's husband, Asif Ali Zardari (later elected President of Pakistan), as well as other PPP members from jail. The hijackers also required the plane to be refuelled to fly to Australia.[citation needed] The next morning, 27 March, at 02:30, the hijackers pushed two (male) flight attendants, flight steward Bernard Tan and chief steward Philip Cheong, out of the aircraft, after the plane had been moved to the outer tarmac.[citation needed]\n\nAt 06:45, the hijackers gave a last 5-minute deadline, and issued a threat to kill one passenger every ten minutes if their demands were still not met. With three minutes to go, orders were given to initiate the assault: the Singapore Armed Forces Commando Formation (SAF CDO FN) stormed the plane in a 30-second sweep, killing all four hijackers with no injuries to hostages. The hijack leader had been shot five times in the chest, but was still alive. He then attempted to stand and ignite his explosive but a commando shot him dead before he did so. The plane was completely secured by 06:50"
